import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Button, Alert, Breadcrumb, Card, Image } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

import honoluluImage from './images/honolulu.jpeg';

import { Navbar, Nav, NavDropdown } from 'react-bootstrap';

function NavBar() {
  return (
    <Navbar bg="transparent" expand="lg">
      <Navbar.Brand style={{ color: 'black' }} href="#home">Logo</Navbar.Brand>
      <Navbar.Brand style={{ color: 'black' }} href="#home">JBCH Hawaii</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link style={{ color: 'black' }} href="#about-us">About Us</Nav.Link>
          <NavDropdown title="Location" id="basic-nav-dropdown" style={{ color: 'black' }}>
            <NavDropdown.Item href="#location-1" style={{ color: 'black' }}>Location 1</NavDropdown.Item>
            <NavDropdown.Item href="#location-2" style={{ color: 'black' }}>Location 2</NavDropdown.Item>
            {/* Add more locations as needed */}
          </NavDropdown>
          <Nav.Link style={{ color: 'black' }} href="#plan-a-visit">Plan a Visit</Nav.Link>
          <Nav.Link style={{ color: 'black' }} href="#give">Give</Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link style={{ color: 'black' }} href="#menu">Menu</Nav.Link>
          {/* You can add more items here if needed */}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

function App() {
  return (
    <div className="Body">
      <Image src={honoluluImage} alt="Honolulu" fluid />
      <NavBar/>
      <header className="App-header">
        <Card >
          <Card.Img />
          <Card.Body>
            <Card.Title>
              Card Example
            </Card.Title>
            <Card.Text>
              This is an example of react boostrap cards.
            </Card.Text>
            <Button variant="seconary">Read More</Button>
          </Card.Body>

        </Card>
        <Breadcrumb>
          <Breadcrumb.Item>Test1</Breadcrumb.Item>
          <Breadcrumb.Item>Test2</Breadcrumb.Item>
          <Breadcrumb.Item active>Test3</Breadcrumb.Item>
        </Breadcrumb>
        <Alert variant="primary">This is a button</Alert>
        <Button>  Test Button</Button>

      </header>
    </div>
  );
}

export default App;
